body:
Seems ONNX changed its behavior between opsets, as the otherwise identical model passed previously. Opset 13 now returns `axis` = 1, even when the model doesn't actually contain an `axis` attribute and even when no per-tensor/layer broadcasting applies. See there is no `axis` attribute in the actual model file...

```
ir_version: 7
producer_name: "backend-test"
graph {
  node {
    input: "x"
    input: "y_scale"
    input: "y_zero_point"
    output: "y"
    op_type: "QuantizeLinear"
  }
  name: "test_quantizelinear"
  input {
    name: "x"
    type {
      tensor_type {
        elem_type: 1
        shape {
          dim {
            dim_value: 6
          }
        }
      }
    }
  }
  input {
    name: "y_scale"
    type {
      tensor_type {
        elem_type: 1
        shape {
        }
      }
    }
  }
  input {
    name: "y_zero_point"
    type {
      tensor_type {
        elem_type: 2
        shape {
        }
      }
    }
  }
  output {
    name: "y"
    type {
      tensor_type {
        elem_type: 2
        shape {
          dim {
            dim_value: 6
          }
        }
      }
    }
  }
}
opset_import {
  domain: ""
  version: 13
}
```

...but the DML EP validates the axis attribute for the 1D tensor, and since 1 >= 1, it fails.
